    return(
        <>
            <div className="h-screen border">
            <div className='border grid grid-cols-3 grid-rows-4'>
            <div className='border'>
            <div class="p-1 border rounded-2xl w-1/4">
                <a class="block p-6 bg-white sm:p-8 rounded-xl" href="">
                    <div class="mt-16 sm:pr-8">
                    <h5 class="text-xl font-bold text-gray-900">Science of Chemistry</h5>

                    <p class="mt-2 text-sm text-gray-500">
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Ad, adipisci.
                    </p>
                    </div>
                </a>
                </div>
                </div>
                </div>
            </div>
        </>
    );
}

function Body(){
    return(
        <>
            <BODY />
        </>
    );
}

export default Body;
